import React from 'react'
import data from './data';
import Equipment from './Equipment'

function EquipmentManager() {
    return (
        <div className="wrapper">
         <h1>Recommended</h1>
      {data.map(equipment => (
        <Equipment 
        key={equipment.name}
        name={equipment.name}
        image={equipment.image}
        />
      ))}
        </div>
    )
} 

export default EquipmentManager
